// Header.js
import React from 'react';
import { useNavigate } from 'react-router-dom';

const Header = () => {
    const navigate = useNavigate();

    const handleClick = () => {
        // Navigate to /your-link
        navigate('/login');
      };
  return (

    <div>
        <div class="logo-group" style={{display: "flex", flexDirection: "row", height: "74px", paddingLeft: "24px", paddingRight: "24px", borderRadius: "5px"}}>
			<img src="/assets/images/logo_main.png" alt="Phishducation logo"></img>
		</div>
        <button class="logBtn" onClick={handleClick}>Login</button>
        <a href = '/signup'>Register</a>
    </div>
  );
};

export default Header;
